-- 导出  表 sl_base.sl_message 结构
CREATE TABLE IF NOT EXISTS `sl_message` (
  `id` bigint unsigned NOT NULL DEFAULT '0' COMMENT 'id(唯一索引)',
  `title` varchar(50) NOT NULL COMMENT '消息标题',
  `content` varchar(1024) NOT NULL COMMENT '消息内容',
  `bussiness_type` tinyint NOT NULL DEFAULT '0' COMMENT '1：用户端，2：司机端，3：快递员端，4：后台管理系统',
  `user_id` bigint NOT NULL DEFAULT '0' COMMENT '消息接受者',
  `content_type` int NOT NULL DEFAULT '0' COMMENT '消息类型，300：快递员端公告，301：寄件相关消息，302：签收相关消息，303：快件取消消息，304:派件相关消息，200：司机端公告，201：司机端系统通知',
  `is_read` tinyint NOT NULL DEFAULT '0' COMMENT '消息是否已读，0：未读，1：已读',
  `read_time` datetime DEFAULT NULL COMMENT '读时间',
  `relevant_id` bigint NOT NULL DEFAULT '0' COMMENT '相关id',
  `created` datetime NOT NULL COMMENT '创建时间',
  `create_user` bigint NOT NULL DEFAULT '0' COMMENT '创建者',
  `updated` datetime NOT NULL COMMENT '更新时间',
  `update_user` bigint NOT NULL DEFAULT '0' COMMENT '更新者',
  `is_delete` tinyint NOT NULL DEFAULT '0' COMMENT '逻辑删除，0：未删除，1：已删除',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `bussiness_type` (`bussiness_type`,`content_type`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE,
  KEY `created` (`created`) USING BTREE,
  KEY `updated` (`updated`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=DYNAMIC COMMENT='消息表';

